(40, 1, '2017-08-24 04:39:35', '2017-08-24 04:39:35', 'A truly outstanding experience! My husband and I had a fabulous 5 nights staying at Soho Hotel, I cannot recommend this hotel enough! And their website is just great, so easy to use! If I were to recommend a hotel website theme it’d be this one!', 'Testimonial #1', '', 'publish', 'closed', 'closed', '', 'testimonial-1', '', '', '2017-08-24 04:39:35', '2017-08-24 04:39:35', '', 0, 'http://themes.quitenicestuff2.com/sohohotelwp/demo1/?post_type=testimonial&amp;p=40', 0, 'testimonial', '', 0),
